import curses
import argparse

pth = "root"

dt = []

# Set up the screen
cr = curses.initscr()
curses.noecho()         # Don't echo user input to the screen
cr.keypad(True)     # Enable keypad mode
curses.curs_set(0)      # Hide the cursor

funcs = ["Index", "SymLink"]
cfunc = 0
dist = 30
rules = {"Index": ["deny", "allow"], "SymLink": ["allow", "deny"]}

def get_rule(fn):
    for i in dt:
        if i["name"] == fn:
            return i["rule"]
    return rules[fn][0]

def save(func, val):
    global dt
    for i in dt:
        if i["name"] == func:
            i["rule"] = val
            return
    dt += [{"name":func, "rule":val}]

def next_rule():
    cfn = funcs[cfunc]
    rulepos = rules[cfn].index(get_rule(cfn))
    if rulepos < len(rules[cfn])-1:
        save(cfn, rules[cfn][rulepos+1])
    else:
        save(cfn, rules[cfn][0])

def prev_rule():
    cfn = funcs[cfunc]
    rulepos = rules[cfn].index(get_rule(cfn))
    if rulepos > 0:
        save(cfn, rules[cfn][rulepos-1])
    else:
        save(cfn, rules[cfn][-1])

def getl(nm):
    if nm not in funcs:
        return "no such function"

    if cfunc == funcs.index(nm):
        rt = f"'{nm}'"
    else:
        rt = nm

    return rt + (" "*(dist-len(rt))) + get_rule(nm)

def astr():
    cr.addstr(f"current path: {pth}\n\n")
    cr.addstr(f"{getl('Index')}\n")
    cr.addstr(f"{getl('SymLink')}\n")
    cr.addstr("\nuse arrow keys to navigate. press q to exit\n")
    cr.move(0, 0)

astr()

# Main loop
while True:
    key = cr.getch()  # Get a single key press

    # React to the key press
    if key == ord('q'):   # Quit the loop if 'q' is pressed
        break

    if key == curses.KEY_UP and cfunc > 0:
        cfunc -= 1
    if key == curses.KEY_DOWN and cfunc < len(funcs)-1:
        cfunc += 1
    if key == curses.KEY_LEFT:
        prev_rule()
    if key == curses.KEY_RIGHT:
        next_rule()
    

    astr()
    cr.refresh()  # Refresh the screen

# Clean up
curses.endwin()

