// Strategy Interface
interface DiscountStrategy {
  calculateTotalCost(prices: number[]): number;
}

// Concrete Strategy 1: No Discount
class NoDiscount implements DiscountStrategy {
  calculateTotalCost(prices: number[]): number {
    return prices.reduce((total, price) => total + price, 0);
  }
}

// Concrete Strategy 2: 10% Discount
class TenPercentDiscount implements DiscountStrategy {
  calculateTotalCost(prices: number[]): number {
    const total = prices.reduce((total, price) => total + price, 0);
    return total * 0.9; // 10% discount
  }
}

// Context
class ShoppingCart {
  private discountStrategy: DiscountStrategy;

  constructor(strategy: DiscountStrategy) {
    this.discountStrategy = strategy;
  }

  setStrategy(strategy: DiscountStrategy) {
    this.discountStrategy = strategy;
  }

  getTotalCost(prices: number[]): number {
    return this.discountStrategy.calculateTotalCost(prices);
  }
}

