def accommodate_new_pets(capacity: int, weight_per_pet: float, *pet_data: tuple):
    accommodated_pet = {}
    total_accommodated = 0
    pets = []

    def accommodated_pets():
        if len(pets) == len(pet_data):
            return f"All pets are accommodated! Available capacity: {capacity}."
        else:
            return "You did not manage to accommodate all pets!"

    def print_accommodated_pets(pets_accommodated):
        pets_info = '\n'.join([f"{p}: {len(c)}" for p, c in sorted(pets_accommodated.items())])
        return f"Accommodated pets:\n" \
               f"{pets_info}"

    for pet_info in pet_data:
        pet_type, pet_weight = (pet_info[0]), float(pet_info[1])

        if capacity > 0:
            if pet_weight > weight_per_pet:
                pets.append(pet_type)
                continue

            else:
                total_accommodated += 1
                if pet_type not in accommodated_pet:
                    accommodated_pet[pet_type] = [pet_weight]
                else:
                    accommodated_pet[pet_type].append(pet_weight)
                capacity -= 1
                pets.append(pet_type)

        else:
            break

    return f"{accommodated_pets()}\n" \
           f"{print_accommodated_pets(accommodated_pet)}"

